[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#MetidaBioeq.bioequivalence","page":"API","title":"MetidaBioeq.bioequivalence","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaBioeq.bioequivalence","category":"page"},{"location":"api/#MetidaBioeq.bioequivalence","page":"API","title":"MetidaBioeq.bioequivalence","text":"bioquivalence(data;\nvars = nothing,\nsubject = :subject,\nperiod = :period,\nformulation = :formulation,\nsequence = :sequence,\nstage = nothing,\nreference = nothing,\ndesign = nothing,\nio::IO = stdout,\nseqcheck = true,\ndropcheck = true,\nlogt = true)\n\nvars - variabel's column(s);\nsubject - subject's column;\nperiod - period's column;\nformulation - formulation's column;\nsequence -sequence's column;\nstage - stage's column;\nreference - reference value for formulation column;\ndesign - design: \"parallel\", \"2X2\", \"2X2X2\", \"2X2X4\", ets. (formulations X sequences X periods);\nseqcheck - check sequencs;     \ndropcheck - dropuot check;\nlogt - if true (default) data is already log-transformed, else log() will be used.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaBioeq.makeseq","page":"API","title":"MetidaBioeq.makeseq","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaBioeq.makeseq","category":"page"},{"location":"api/#MetidaBioeq.makeseq","page":"API","title":"MetidaBioeq.makeseq","text":"makeseq(data;\n    subject = :subject,\n    period = :period,\n    formulation = :formulation)\n\nMake sequence vector from data and subject, period, formulation columns.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaBioeq.result","page":"API","title":"MetidaBioeq.result","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaBioeq.result","category":"page"},{"location":"#Bioequivalence","page":"Home","title":"Bioequivalence","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Bioequivalence is a term in pharmacokinetics used to assess the expected in vivo biological equivalence of two proprietary preparations of a drug. If two products are said to be bioequivalent it means that they would be expected to be, for all intents and purposes, the same.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Birkett (2003) defined bioequivalence by stating that, \"two pharmaceutical products are bioequivalent if they are pharmaceutically equivalent and their bioavailabilities (rate and extent of availability) after administration in the same molar dose are similar to such a degree that their effects, with respect to both efficacy and safety, can be expected to be essentially the same. Pharmaceutical equivalence implies the same amount of the same active substance(s), in the same dosage form, for the same route of administration and meeting the same or comparable standards.\"","category":"page"},{"location":"","page":"Home","title":"Home","text":"For The World Health Organization (WHO) \"two pharmaceutical products are bioequivalent if they are pharmaceutically equivalent or pharmaceutical alternatives, and their bioavailabilities, in terms of rate (Cmax and tmax) and extent of absorption (area under the curve), after administration of the same molar dose under the same conditions, are similar to such a degree that their effects can be expected to be essentially the same\".","category":"page"},{"location":"","page":"Home","title":"Home","text":"The United States Food and Drug Administration (FDA) has defined bioequivalence as, \"the absence of a significant difference in the rate and extent to which the active ingredient or active moiety in pharmaceutical equivalents or pharmaceutical alternatives becomes available at the site of drug action when administered at the same molar dose under similar conditions in an appropriately designed study.\"","category":"page"},{"location":"#Requirements:","page":"Home","title":"Requirements:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Julia ≥1.8+\nMixedModels ≥4.11\nGLM ≥1.8.2\nMetida ≥0.14.6","category":"page"},{"location":"#Reference:","page":"Home","title":"Reference:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"EMA: GUIDELINE ON THE INVESTIGATION OF BIOEQUIVALENCE\nEMA: GUIDELINE ON THE INVESTIGATION OF BIOEQUIVALENCE, Annex I\nFDA: Guidance for Industry Statistical Approaches to Establishing Bioequivalence\nEEU: Regulations conducting BE studies within the framework of the EEU\nChow SC. Bioavailability and Bioequivalence in Drug Development. Wiley Interdiscip Rev Comput Stat. 2014;6(4):304-312. doi: 10.1002/wics.1310. PMID: 25215170; PMCID: PMC4157693.\nLu D, Lee SL, Lionberger RA, Choi S, Adams W, Caramenico HN, Chowdhury BA, Conner DP, Katial R, Limb S, Peters JR, Yu L, Seymour S, Li BV. International Guidelines for Bioequivalence of Locally Acting Orally Inhaled Drug Products: Similarities and Differences. AAPS J. 2015 May;17(3):546-57. doi: 10.1208/s12248-015-9733-9. Epub 2015 Mar 11. PMID: 25758352; PMCID: PMC4406956.\nDavit BM, Chen ML, Conner DP, Haidar SH, Kim S, Lee CH, Lionberger RA, Makhlouf FT, Nwakama PE, Patel DT, Schuirmann DJ, Yu LX. Implementation of a reference-scaled average bioequivalence approach for highly variable generic drug products by the US Food and Drug Administration. AAPS J. 2012 Dec;14(4):915-24. doi: 10.1208/s12248-012-9406-x. Epub 2012 Sep 13. PMID: 22972221; PMCID: PMC3475857.\nKaza, M., Sokolovskyi, A. & Rudzki, P.J. 10th Anniversary of a Two-Stage Design in Bioequivalence. Why Has it Still Not Been Implemented?. Pharm Res 37, 140 (2020). https://doi.org/10.1007/s11095-020-02871-3\nSchütz, H., Labes, D., & Fuglsang, A. (2014). Reference datasets for 2-treatment, 2-sequence, 2-period bioequivalence studies. The AAPS journal, 16(6), 1292–1297. https://doi.org/10.1208/s12248-014-9661-0\nFuglsang A, Schütz H, Labes D. Reference datasets for bioequivalence trials in a two-group parallel design. AAPS J. 2015 Mar;17(2):400-4. doi: 10.1208/s12248-014-9704-6. Epub 2014 Dec 9. PMID: 25488055; PMCID: PMC4365103.\nBioequivalence reference datasets: Schütz, H., Labes, D., Tomashevskiy, M. et al. Reference Datasets for Studies in a Replicate Design Intended for Average Bioequivalence with Expanding Limits. AAPS J 22, 44 (2020). https://doi.org/10.1208/s12248-020-0427-6","category":"page"},{"location":"#See-also:","page":"Home","title":"See also:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"https://github.com/PharmCat/MetidaNCA.jl\nhttps://github.com/PharmCat/Metida.jl\nhttps://juliastats.org/GLM.jl/stable/\nhttps://juliastats.org/MixedModels.jl/stable/\nhttps://bebac.at/\nhttps://pharmcat.net/","category":"page"},{"location":"example/#Example","page":"Example","title":"Example","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"using MetidaBioeq, CSV, DataFrames, CategoricalArrays;\n\nbedf2x2 = CSV.File(joinpath(dirname(pathof(MetidaBioeq)), \"..\", \"test\", \"csv\",  \"2x2rds1.csv\")) |> DataFrame\ntransform!(bedf2x2, :Subject => categorical, renamecols = false)\ntransform!(bedf2x2, :Period => categorical, renamecols = false)\nbedf2x2.logVar = log.(bedf2x2.Var)\n\nnothing; # hide","category":"page"},{"location":"example/#Data","page":"Example","title":"Data","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"bedf2x2[1:5, :]","category":"page"},{"location":"example/#BE-object","page":"Example","title":"BE object","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    be2 = MetidaBioeq.bioequivalence(bedf2x2, \n    vars = :Var, \n    subject = :Subject, \n    formulation = :Formulation, \n    period = :Period,\n    sequence = :Sequence, \n    reference = \"R\",\n    design = \"2x2\",\n    autoseq = true,\n    logt = false)","category":"page"},{"location":"example/#Estimation","page":"Example","title":"Estimation","text":"","category":"section"},{"location":"example/#GLM","page":"Example","title":"GLM","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    beAglm  = MetidaBioeq.result(be2;  estimator = \"glm\", method = \"A\")","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"    beAglm.models[1]","category":"page"},{"location":"example/#MixedModels","page":"Example","title":"MixedModels","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    beBmm  = MetidaBioeq.result(be2;  estimator = \"mm\", method = \"B\")","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"    beBmm.models[1]","category":"page"},{"location":"example/#Metida","page":"Example","title":"Metida","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    beBmet  = MetidaBioeq.result(be2;  estimator = \"met\", method = \"B\")","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"    beBmet.models[1]","category":"page"}]
